// Menu.js
import React from 'react';
import { Link } from 'react-router-dom';

const Menu = () => {
  return (
    <nav>
      {/* Dodaj linki do rejestracji i logowania tutaj */}
      <Link to="/register">Rejestracja</Link>
      <Link to="/login">Logowanie</Link>
    </nav>
  );
};

export default Menu;
